import React from 'react';

class Menu extends React.Component {
    
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <footer class="footer text-center">
                <div class="container">
                    <div class="row">
                        <div class="col-lg-4 mb-5 mb-lg-0">
                            <h3><a href="/Profil">Profil</a></h3>
                        </div>
                        <div class="col-lg-4 mb-5 mb-lg-0">
                            <h3><a href="/">Promo</a></h3>
                        </div>
                        <div class="col-lg-4 mb-5 mb-lg-0">
                            <h3><a href="/">Messages</a></h3>
                        </div>
                        <div class="col-lg-4 mb-5 mb-lg-0">
                            <h3><a href="/">Plus</a></h3>
                        </div>
                    </div>
                </div>
            </footer>
        );
    }
}

export default Menu;
